import React from "react";
import "../styles/dashboard.css"
import File from "../components/File.js"

function DashboardNavBar(){
    return(
        <div className="navBar" >
            <ul className="remove-ul-style">
                <li className="nvUpperLeftOptions">
                    <button>
                        &#9776;
                    </button>
                </li>
                <li><div id="navbar-logo-container"><img id="navbar-logo" src="./images/virtual-version-log.png"></img></div></li>
                <li className="nvUpperRightOptions"><Link to="/file"><button className="hp-buttons">New File</button></Link></li>
            </ul>
        </div>
    );
}

export default DashboardNavBar;
